function Cards(props){
    return (
        <>
        
        <div className="card"  style={{display:'inline-block'}}>
            <img src={props.srcImage} alt='trend' style={{width:"200px"}}/>
            <div className="container">
                <h4><b>{props.title}</b></h4>
                <p>{props.typeTrend}</p>
            </div>
        </div>
        </>
    );
}

export default Cards;
